In the execution time, the retry number will be initilaized:
   maxRetryNum = sga->getSGRetryNum();
I have tested this, it is very simple to reproduce it. But I will double check it.

The 2048 size is the maximum it can grow to - it won't be set to 2048 anymore.
Also there is this calculation for the upsert case specifically in GenRelUpdate.cpp  

  if ((getInsertType() == Insert::VSBB_INSERT_USER || // covers upsert
       getInsertType() == Insert::UPSERT_LOAD)  && // covers upsert using load and bulk load
      generator->oltOptInfo()->multipleRowsReturned())
  {
    downqueuelength = getDefault(HBASE_ROWSET_VSBB_SIZE);
    queue_index dq = 1;
    queue_index bits = downqueuelength;
    while (bits && dq < downqueuelength) {
        bits = bits  >> 1;
        dq = dq << 1;
    }
    downqueuelength = dq;
  }

In addition, in the Unpack operator, we further limit queue lengths based on rowlength otherwise the rowset becomes too large to fit in memory. So there is a lot of manipulation of queue lengths throughout the code .
